class Solution:
    # @param S, a string
    # @param L, a list of string
    # @return a list of integer
    def findSubstring(self, S, L):
        n = len(L)
        if n == 0:
        	return []

        k = len(L[0])
        l = len(S)
        if k == 0:
        	return range(l)

        if l < n*k:
        	return []

        orignalDic = {}
        for w in L:
        	orignalDic[w] = orignalDic.get(w,0) + 1

        result = []
        for i in range(l-n*k+1):

        	dic = orignalDic.copy()
        	sub = S[i:i+n*k]

        	flag = True

        	for j in range(0,n*k,k):
        		word = sub[j:j+k]
        		dic[word] = dic.get(word,0) - 1
        		if dic[word] < 0:
        			flag = False
        			break
        		elif dic[word] == 0:
        			del dic[word]

        	if flag is False or len(dic)>0:
        		continue
        	result.append(i)
        return result

